import React from 'react';
import './UserPanel.css';

function UserPanelHead({ user, onLogout }) {
  return (
    <>
      <button class="button button-logout">خروج</button>

      <h5>Welcome, {user.username}!</h5>
    </>
  );
}

export default UserPanelHead;
